import React from "react";

export default function AddTransaction() {
  return (
    <div>
      <span className="subtitle">Make Transaction</span>
      <hr />
      <br />
      <form action="">
        <input type="text" />
        <button>Add</button>
      </form>
    </div>
  );
}
